import { useState } from "react";
import "../App.css";

export default function UserLogin() {
  const [count, setCount] = useState(0);

  return (
    <main className="userLogin">
      {count}
      <button
        onClick={() => {
          setCount(count + 1);
        }}
      >
        Get Request
      </button>
    </main>
  );
}
